window.bookSummaryJSON = "<p><b>There are three rules to surviving the Fae—and I'm about to break every single one.</b></p> <p>Rule #1. Never cross into Faerie.</p> <p>When I'm chased across the wicked border and caught by its reclusive ruler of the sky, the pretty trickster with a clever tongue offers me a deal.</p> <p>Rule #2: Never bargain with a Fae.</p> <p>But I don't have a choice. For thirteen days, I have to survive in his mountainous maze of sinister paths, deceptive stairways, and devious creatures. Refuse, and my sisters will suffer as punishment.</p> <p>Rule #3: Never fall for the enemy.</p> <p>I should have known my sexy captor wouldn't play fair. The deeper I plunge into this dangerous world of Solitary Fae, the more I'm entangled in their ruler's seductive web of desire—and the forbidden temptations he offers.</p> <p>The price of losing this wicked game is everything I love. But winning might just cost me my heart.</p> <p>Kiss the Fae<i> is the first book in Natalia Jaster's scorching fantasy romance series, Dark Fables: Vicious Faeries. If you like heavy steam, enemies to lovers, and morally grey book boyfriends, be prepared to swoon for the villain. Intended for mature listeners.</i></p>"; 
